    // },
    // { title: 'bad', singer: 'michael jackson', id: uuid() },
    // { title: 'aquarela', singer: 'toquinho', id: uuid() }
  ]);

  return (
    <SongContext.Provider value={{ songs }}>
      {props.children}
    </SongContext.Provider>
  );
};

export default SongContextProvider;
